class TestInputData(unittest.TestCase):
    #  корректный отчёт
    def test_successful(self):
        lst = check_odt(test_student, test_report, test_file)
        self.assertEqual(len(lst), 0)

    def test_mistake_student_without_name(self):
        student = test_student.copy()
        student.pop("name")
        error = check_odt(student, test_report, test_file)
        self.assertEqual(error, 1)

    def test_mistake_student_without_surname(self):
        student = test_student.copy()
        student.pop("surname")
        error = check_odt(student, test_report, test_file)
        self.assertEqual(error, 1)

